import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './services/App';
import 'tachyons';

import { createRoot } from 'react-dom/client';
const root = createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);


